import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import Process from "./components/process";

class App extends Component {
  render() {
    return (
      <main className="container">
        <Process processName="Precess number 1" />
      </main>
    );
  }
}

export default App;
